        let tooltip = new Container();
        tooltip.visible = false;
        tooltip.x = bagUiBg.x + cubby.x + bagUiBg.line.width + uiLayout.uiWindow.margin - uiLayout.tooltip.width + (uiLayout.cubby.size / 2);
